import 'bootstrap/dist/css/bootstrap.min.css'
import Main from './components/Main';
import {Route, Routes} from 'react-router-dom';



function App() {
  return (
    <>
      <Routes>
        <Route path="/">
          <Main />
        </Route>
      </Routes>


    </>
  );
}

export default App;
